package operator1;

public class operators {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int a=100;
		int b=20;
		System.out.println(a+b);
		System.out.println(a-b);
		System.out.println(a*b);
		System.out.println(a/b);
		System.out.println(a%b);
		
		System.out.println(a>b&&b>a);
		System.out.println(a>b||b>a);
		
		System.out.println(a++ + ++a);
		System.out.println(a-- - --a);
		
		System.out.println(a>b);
		System.out.println(a<b);
		System.out.println(a==b);
		System.out.println(a!=b);
	}

}
